func Test_Tx(t *testing.T) {
	// 65cbf31895f6cab997e6c3688b2263808508adc69bcc9054eef5efac6f7895d3
	txHex := ""
	tx, _ := bt.NewTxFromString(txHex)

	scriptInterpreter := newScriptVerifierGoSDK(ulogger.TestLogger{}, settings.NewPolicySettings(), chaincfg.GetChainParamsFromConfig())
	err := scriptInterpreter.VerifyScript(tx, 720899)
	require.NoError(t, err)

	txBytes := tx.ExtendedBytes()

	// extended 65cbf31895f6cab997e6c3688b2263808508adc69bcc9054eef5efac6f7895d3
	txEHex := ""
	txE, _ := bt.NewTxFromString(txEHex)
	txEBytes := txE.Bytes()
	assert.Equal(t, txEHex, hex.EncodeToString(txE.ExtendedBytes()))

	assert.Equal(t, txHex, hex.EncodeToString(txE.Bytes()))

	assert.Equal(t, hex.EncodeToString(tx.Bytes()), hex.EncodeToString(txE.Bytes()))

	err = scriptInterpreter.VerifyScript(txE, 729000)
	require.NoError(t, err)

	assert.Equal(t, tx.TxID(), txE.TxID())
	assert.Equal(t, hex.EncodeToString(tx.Bytes()), hex.EncodeToString(txE.Bytes()))

	// we are storing this tx as e523599bfc10772248f7244a204e837193bf1676aa04b3a2978e5c9ca3060674 for some reason :-S
	tx2, _ := bt.NewTxFromBytes(txBytes)
	txE2, _ := bt.NewTxFromBytes(txEBytes)

	assert.Equal(t, tx.TxID(), tx2.TxID())
	assert.Equal(t, tx.TxID(), txE2.TxID())
	assert.Equal(t, txE.TxID(), txE2.TxID())
}

func TestGoBt2GoSDKTransaction(t *testing.T) {
	t.Run("TestGoBt2GoSDKTransaction", func(t *testing.T) {
		txBytes := largeTx.Bytes()
		sdkTx := goBt2GoSDKTransaction(largeTx)

		assert.Equal(t, largeTx.TxID(), sdkTx.TxID().String())
		assert.Equal(t, txBytes, sdkTx.Bytes())
	})
}

func BenchmarkVerifyTransactionGoBt(b *testing.B) {
	scriptInterpreter := newScriptVerifierGoBt(ulogger.TestLogger{}, settings.NewPolicySettings(), chaincfg.GetChainParamsFromConfig())
	txHex, err := os.ReadFile("./testdata/f65ec8dcc934c8118f3c65f86083c2b7c28dad0579becd0cfe87243e576d9ae9.bin")
	require.NoError(b, err)
	tx, err := bt.NewTxFromBytes(txHex)
	require.NoError(b, err)

	b.Run("BenchmarkCheckScripts", func(b *testing.B) {
		for i := 0; i < b.N; i++ {
			_ = scriptInterpreter.VerifyScript(tx, 740975)
		}
	})
}

